smd({
            pattern: "tiktok",
	    alias :  ['tt','ttdl'],
            desc: "Downloads Tiktok Videos Via Url.",
            category: "downloader",
            filename: __filename,
            use: '<add tiktok url.>'
        },

        async(Void, citel, text) => {
 if(!text) return await citel.reply(`${fancytext("please give me tiktok video link",1)}`);
 let txt = text ? text.split(" ")[0]:'';
 if (!/tiktok/.test(txt)) return await citel.reply(`${fancytext("please give me valid tiktok video link!",1)}`);
 const { status ,thumbnail, video, audio } = await tiktokdl(txt)
 //console.log("url : " , video  ,"\nThumbnail : " , thumbnail ,"\n Audio url : " , audio )
 if (status) return await Void.sendMessage(citel.chat, {video : {url : video } , caption: `*   ${sigma_config.botname}` } , {quoted : citel });
 else return await citel.reply(`${fancytext("error while downloading your video",1)}`) 


})
